import {ADD_ITEM,DELETE_ITEM} from './todoTypes'

export const addItem = () => {
    return {
        type:ADD_ITEM,
        info:'addItem'
    }
}

export const deleteItem = () => {
    return {
        type:DELETE_ITEM,
        info:'deleteItem'
    }
}
